import React from "react";
import "./Navbar.css";

import { useRef } from "react";
import { Link } from "react-router-dom";
import { useState } from "react";
import Button from "../Button/Button";

const Navbar = () => {

  const [fix, setFix] = useState(false);
  function setFixed() {
    if(window.scrollY >= 1000 && window.scrollY <= 1920) {
        setFix(true)
    } else {
        if(window.scrollY >= 2800 && window.scrollY <= 3700) {
            setFix(true)
        } else {
            setFix(false)
        }
    }
  }
  window.addEventListener("scroll", setFixed)

  const one = useRef(null);
  const two = useRef(null);
  const three = useRef(null);
  const four = useRef(null);
  const five = useRef(null);

  const scrollToSection = (elementRef) => {
    window.scrollTo({
        top: elementRef.current.offsetTop,
        behavior: 'smooth',
    })
  }

  return (
    <nav className={fix ? 'navbar fixed': 'navbar'}>
      <a onClick={() => scrollToSection(one)} className="title">
        Call App
      </a>
      <ul>
        <li>
          <a onClick={() => scrollToSection(two)}>About</a>
        </li>

        <li>
          <a onClick={() => scrollToSection(five)}>Contact</a>
        </li>
        <li className="btn">
          <a href="SignIn"><Button>Log In</Button></a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
